import React from "react";
import { SafeAreaView } from 'react-native-safe-area-context'
import { View, Text } from "react-native";
import { COLORS } from '../constants'
import Button from '../components/Button'

const Setting = ({ navigation, route  }) => {
  // Extract the username from the route parameters
  const {username} = route.params;

  return (
    <SafeAreaView style={{flex: 1, backgroundColor: COLORS.white}}>
      <View style={{marginHorizontal: 22,marginTop: 25}}>
                <View style={{flexDirection: "row", justifyContent: "space-between", alignItems: "center" }}>
                    <Image source={images.logo} resizeMode="contain" style={{ width: 88, height: 32 }}/>
                    <View>
                        <Text style={{...FONTS.h3}}>Welcome <Text style={{color:"green"}}>{username}</Text></Text>
                    </View>
                </View> 
        <View>
          <Button mode="contained"  style={{width: 100, height: 50}} onPress={() => navigation.navigate('StartScreen')}>Logout</Button>
        </View>
      </View>
    </SafeAreaView>
  );
};
export default Setting
